import PropTypes from 'prop-types';
import './CssPages/Loading.css';

export default class Loading extends Component {
  constructor(props) {
    super(props);
    this.state = {
      routerDirection: '',
    };
  }

  componentDidMount() {
    this.handleSetRoute();
  }

  handleSetRoute = (props) => {
    const { history } = this.props.match;
    this.setState({ routerDirection: props });
    console.log(history);

    history.push(routerDirection);
  }

  render() {
    const { className } = this.props;
    return (
      <div className={ className }>
        <h1>Carregando...</h1>
      </div>
    );
  }
}

Loading.propTypes = {
  className: PropTypes.string.isRequired,
};
